#include <iostream>
#include <vector>
#include <queue>

using namespace std;

class Solution {
public:
    int n;
    
    bool in_board(int x, int y) {return x >= 0 && x < n && y >= 0 && y < n;};
    
    int maxDistance(vector<vector<int>>& grid) {
        n = grid[0].size();
        queue<pair<int,int>> que;
        for (int i = 0; i < n; i++){
            for (int j = 0; j < n; j++){
                if (grid[i][j] == 1) que.push({i,j});
            }
        }

        vector<int> xd = {-1,0,1,0};
        vector<int> yd = {0,1,0,-1};

        int ans = -1;
        while(!que.empty()){
            ans++;
            int s = que.size();
            while(s--){
                pair<int,int> p = que.front();
                que.pop();
                for (int d = 0; d < 4; d++){
                    int newx = p.first + xd[d];
                    int newy = p.second + yd[d];
                    if (in_board(newx, newy) && grid[newx][newy] == 0){
                        grid[newx][newy] = 1;
                        que.push({newx,newy});
                        // cout << "{" << newx << "," << newy << "} ";
                    }
                }
            }
            // cout << endl;
        }
        return (ans == 0)? -1 : ans;
    }
};

